import React from 'react';
import SavedTeams from './SavedTeams';
import '../styles/TeamsPage.css';

const TeamsPage = ({ userId, onLoadTeam, onNavigateHome }) => {
  return (
    <div className="teams-page">
      <div className="teams-page-container">
        <div className="teams-page-header">
          <h1>üìö My Saved Teams</h1>
          <p>Click a team to load it and continue building</p>
        </div>

        <div className="teams-page-content">
          <SavedTeams 
            userId={userId} 
            onLoadTeam={(team) => {
              onLoadTeam(team);
              onNavigateHome();
            }} 
            compact={false}
          />
        </div>

        <div className="teams-page-footer">
          <button 
            className="back-to-build-btn"
            onClick={onNavigateHome}
          >
            ‚Üê Back to Team Builder
          </button>
        </div>
      </div>
    </div>
  );
};

export default TeamsPage;
